import "./Hero.css";

function Hero() {
  return (
    <section class="hero">
      <div class="to_linkdin">
        <h2>
          <a href="linkedin.com/mitch-brotherson" alt="contact-me">
            Click here to get in contact with me!!
          </a>
        </h2>
      </div>
    </section>
  );
}

export default Hero;
